sys_variable_value.value:
(function execute(inputs, outputs) {
    outputs.are_all_tasks_done_ = true;
    
    if (!inputs.taskRecords.hasNext()) {
        return;
    }
    
    while (inputs.taskRecords.next()) {
        if (inputs.taskRecords.state != '2' && inputs.taskRecords.state != '3') {
            outputs.are_all_tasks_done_ = false;
            return;
        }
    }
})(inputs, outputs);

